namespace Tests\Unit\Jobs\Ava;

use Tests\TestCase;
use App\Jobs\Ava\ExportApplication;
use Illuminate\Support\Facades\Storage;

class ExportApplicationTest extends TestCase
{
    /** @test */
    public function it_exports_a_vacancy_application_to_pdf()
    {
        Storage::fake(config('vandango.ava.disk'));

        dispatch(new ExportApplication($this->application()));

        Storage::disk(config('vandango.ava.disk'))->assertExists('Ava/Applications/example-organisation-example-job-title-vac00123456789/John Doe - AVA000123456.pdf');
    }

