p would allow me to work a lot better in a team. At the moment I am able to work in a team when completing tasks however I think I am still able to develop when speaking my mind and ideas to others which could be useful and help the team complete a task which is necessary. Taking part in this apprenticeship would also allow me to be able to want to learn more and be willing to learn as sometimes I am able to complete a task set however when it comes to changing the way that it has been completed it is hard to use the new method if an older version has been completed multiple times. However this weakness can be developed whilst in the apprenticeship to ensure that I am able to quickly change and accept a different method."},"other_hobbies":{"question":"What are your hobbies and interests?","answer":"I personally enjoy building things and being active with my hands. This could include building 3-d puzzles or problems that need to be completed in order to complete a goal. I have not yet got any achievements or rewards for anything that would fit into this category for the apprenticeship, however my ambitions are to become some sort of engineer which could allow to earn an achievement."},"questions":[{"question":"How will you travel to work?","answer":"It is possible for me to travel to work in 3 possible ways. The first way that I can definitely get to work is riding a bike to and from the work place every day. My second option could be using the number 38 bus and get very close to the workplace and then walk the further distance. My third option would be to go in a car with a fellow employees and pay towards any fuel costs, however this option is more convenient but not necessary for me to get to work each day."},{"question":"Are you able to start this apprenticeship immediately?","answer":"I am still currently in school but am able to start as soon as I finish at the end of June."},{"question":"Do you have a learning difficulty, disability or health problem?","answer